    this.chooseIcon = function (name, isFolder) {
        if (isFolder) return iconType.iconDefinitions['folder'];
        // fileNames
        var type = iconType.fileNames[name];
        if (typeof type != "undefined") return iconType.iconDefinitions[type];
        // suffix
        var suffix = name.slice(name.lastIndexOf(".") + 1);
        type = iconType.languageIds[suffix];
        if (typeof type != "undefined") return iconType.iconDefinitions[type];
        type = iconType.fileExtensions[suffix];
        if (typeof type != "undefined") return iconType.iconDefinitions[type];
        return iconType.iconDefinitions['file'];
    }
